import React from 'react'
import './Signup.css'
import { useNavigate } from "react-router-dom";



const [name, setName] = React.useState("");
const [email, setEmail] = React.useState("");
const [password, setPassword] = React.useState("");
const [password2, setPassword2] = React.useState("");
const [message, setMessage] = React.useState("");

let navigate = useNavigate();

const success = async (text) => {
  console.log("Yeah! Authenticated!");
  await localStorage.setItem("salesToken", text.access);
  window.location = "/"; // Redirect to the desired page after successful signup
};

const trySignup = async (e) => {
  e.preventDefault();
  console.log("Signing up with", name, email, password, password2);
  
  // Call the signup_api function passing the required parameters
  await signup_api(name, email, password, password2, success, (text) => {
    setMessage(text);
  });
};





function Signup() {
  return (
    <div className="Signup-home">
      <div className="Signup-container">
        <span className="Signup-create">Create New Account</span>
        <span className="Sigunp-login-sub">
          Already a member?{' '}
          <a className="Signup-login" href="/Login">
            Log in
          </a>
        </span>
        <input type="text" className="Signup-Email" placeholder="First Name" />
        <input type="email" className="Signup-Email" placeholder="Email" />
        <input type="password" className="Signup-Email" placeholder="Password" />
        <input type="password" className="Signup-Email" placeholder="Confirm Password" />
        <button className="Signup-btn">Signup</button>
      </div>
    </div>
  )
}

export default Signup
